import numpy as np
import random
import sys
import csv
import pandas as pd
import re

cities = ["Dubai",  "New York City",  "Paris",  "Rio de Janeiro"]


def to_numeric(s):
    if isinstance(s, str):
        s = s.replace(",", '')
        s = pd.to_numeric(s, errors="coerce")
    return float(s)

def get_number_list(s):
    return [int(n) for n in re.findall("(\d+)", str(s))]

def get_number_list_clean(s):
    n_list = get_number_list(s)
    n_list += [-1]*(6-len(n_list))
    return n_list

def get_number(s):
    n_list = get_number_list(s)
    return n_list[0] if len(n_list) >= 1 else -1

def find_area_at_rank(l, i):
    return l.index(i) + 1 if i in l else -1

def cat_in_s(s, cat):
    return int(cat in s) if not pd.isna(s) else 0

def process_data(df):
    bag_of_words ={'made', 'dreams', 'life', 'Ã¢', 'la', 'big', 'world', "i'm", 'place', 'de', 'where', 'new', 'nothing', 'tower', 'sleeps', 'dubai', 'beautiful', 'but', 'paris', 'come', 'always', 'rich', 'carnival', 'oui', 'habibi', 'city', 'welcome', 'money', 'love', 'jungle', 'york', 'people', 'never', 'here', 'rio', 'football', 'concrete'}

    df = df.drop("id", axis=1)
    
    def count_words(text, word_list):
        text = str(text).lower()
        return {word: text.count(word) for word in word_list}

    counts = df['Q10'].apply(lambda x: count_words(x, bag_of_words))

    counts_df = pd.DataFrame(counts.tolist())

    df = pd.concat([df, counts_df], axis=1)

    df.drop('Q10', axis=1, inplace=True)

    for i in range(1, 5):
        col_name = f"Q{i}"
        df[col_name] = df[col_name].apply(to_numeric).fillna(0)
    
    for i in range(7, 10):
        col_name = f"Q{i}"
        df[col_name] = df[col_name].apply(to_numeric).fillna(0) 

    df["Q6"] = df["Q6"].apply(get_number_list_clean)
    for i in range(1, 7):
        col_name = f"rank_{i}"
        df[col_name] = df["Q6"].apply(lambda x: find_area_at_rank(x, i))
    
    del df["Q6"]

    for cat in ["Partner", "Friends", "Siblings", "Co-worker"]:
      cat_name = f"Q5{cat}"
      df[cat_name] = df["Q5"].apply(lambda s: cat_in_s(s, cat))

    del df["Q5"]
    return df

