def softmax(z):
    z = z - np.max(z, axis=-1, keepdims=True)
    num = np.exp(z)
    den = np.sum(num, axis=-1, keepdims=True)
    return num / den

def do_forward_pass(model, X):
    model.X = X
    model.Z1 = np.dot(X, model.W1) + model.b1
    model.A1 = np.maximum(0, model.Z1)
    model.Z2 = np.dot(model.A1, model.W2) + model.b2
    model.A2 = np.maximum(0, model.Z2)
    model.Z3 = np.dot(model.A2, model.W3) + model.b3
    model.A3 = np.maximum(0, model.Z3)
    model.Z4 = np.dot(model.A3, model.W4) + model.b4
    model.A4 = softmax(model.Z4)
    return model.A4


def predict_all(filename):
    X = process_data(pd.read_csv(filename))
    model = MLPModel()
    predictions = do_forward_pass(model, X)
    predictions = np.argmax(predictions, axis=1)
    final_predictions = []
    for i in predictions:
        final_predictions.append(cities[i])

    return final_predictions
